import React from 'react';

const Popular = ({fetchMovies}) => {
  useEffect( () => {
    let query= '?primary_release_year=2019&sort_by=vote_average.desc';
    fetchMovies('discover',query);
  }, []);
  return (
    <div className="title-container">
      <h2>Popular</h2>
    </div>
  )
}

export default Popular;
